import { val1Reducer, val1State } from './reducers/val1Reducer';
import { val2Reducer, val2State } from './reducers/val2Reducer';
import { createContext, useReducer } from "react";

export const Val1Context = createContext();
export const Val2Context = createContext();


export function StateManager({ children }) {
    const [state1, dispatchVal1] = useReducer(val1Reducer, val1State);
    const [state2, dispatchVal2] = useReducer(val2Reducer, val2State);
    return <Val1Context.Provider value={{ val1: state1.value1, dispatchVal1: dispatchVal1 }}>
        <Val2Context.Provider value={{ val2: state2.value2, dispatchVal2: dispatchVal2 }}>
            { children }
        </Val2Context.Provider>
    </Val1Context.Provider>
}
